import React from 'react';
import { Navbar } from 'react-bootstrap';


export default function Footer(props) {

    const { } = props;

    return(
        <Navbar bg="light" variant="light" fixed="bottom">
            <Navbar.Collapse className="justify-content-center">
                <div>
                    <div>Icons made by <a href="http://www.dariusdan.com" title="Darius Dan">Darius Dan</a> from <a href="https://www.flaticon.com/" title="Flaticon">www.flaticon.com</a></div><br/>
                    <a target="_blank" href="https://icons8.com/icons/set/user-male-circle">Male User icon</a> icon by <a target="_blank" href="https://icons8.com">Icons8</a>
                </div>
            </Navbar.Collapse>

        </Navbar>
    );
}
